DROP TABLE IF EXISTS productlines;
CREATE TABLE productlines(
  id int(10) unsigned NOT NULL AUTO_INCREMENT primary key,
  `name` varchar(50) NOT NULL unique,
  `description` longtext,
  version int unsigned not null default 0
);

INSERT INTO productlines(`name`,description) VALUES
 ('Classic Cars','Attention car enthusiasts: Make your wildest car ownership dreams come true. Whether you are looking for classic muscle cars, dream sports cars or movie-inspired miniatures, you will find great choices in this category. These replicas feature superb attention to detail and craftsmanship and offer features such as working steering system, opening forward compartment, opening rear trunk with removable spare wheel, 4-wheel independent spring suspension, and so on. The models range in size from 1:10 to 1:24 scale and include numerous limited edition and several out-of-production vehicles. All models include a certificate of authenticity from their manufacturers and come fully assembled and ready for display in the home or office.'),
 ('Motorcycles','Our motorcycles are state of the art replicas of classic as well as contemporary motorcycle legends such as Harley Davidson, Ducati and Vespa. Models contain stunning details such as official logos, rotating wheels, working kickstand, front suspension, gear-shift lever, footbrake lever, and drive chain. Materials used include diecast and plastic. The models range in size from 1:10 to 1:50 scale and include numerous limited edition and several out-of-production vehicles. All models come fully assembled and ready for display in the home or office. Most include a certificate of authenticity.'),
 ('Planes','Unique, diecast airplane and helicopter replicas suitable for collections, as well as home, office or classroom decorations. Models contain stunning details such as official logos and insignias, rotating jet engines and propellers, retractable wheels, and so on. Most come fully assembled and with a certificate of authenticity from their manufacturers.'),
 ('Ships','The perfect holiday or anniversary gift for executives, clients, friends, and family. These handcrafted model ships are unique, stunning works of art that will be treasured for generations! They come fully assembled and ready for display in the home or office. We guarantee the highest quality, and best value.'),
 ('Trains','Model trains are a rewarding hobby for enthusiasts of all ages. Whether you\'re looking for collectible wooden trains, electric streetcars or locomotives, you\'ll find a number of great choices for any budget within this category. The interactive aspect of trains makes toy trains perfect for young children. The wooden train sets are ideal for children under the age of 5.'),
 ('Trucks and Buses','The Truck and Bus models are realistic replicas of buses and specialized trucks produced from the early 1920s to present. The models range in size from 1:12 to 1:50 scale and include numerous limited edition and several out-of-production vehicles. Materials used include tin, diecast and plastic. All models include a certificate of authenticity from their manufacturers and are a perfect ornament for the home and office.'),
 ('Vintage Cars','Our Vintage Car models realistically portray automobiles produced from the early 1900s through the 1940s. Materials used include Bakelite, diecast, plastic and wood. Most of the replicas are in the 1:18 and 1:24 scale sizes, which provide the optimum in detail and accuracy. Prices range from $30.00 up to $180.00 for some special limited edition replicas. All models include a certificate of authenticity from their manufacturers and come fully assembled and ready for display in the home or office.');

CREATE TABLE products (
  id int unsigned NOT NULL AUTO_INCREMENT primary key,
  `name` varchar(70) NOT NULL,
  scale varchar(10) NOT NULL,
  description longtext,
  inStock int unsigned NOT NULL,
  inOrder int unsigned NOT NULL,
  price decimal(10,2) NOT NULL,
  productlineId int unsigned NOT NULL,
  version int unsigned not null default 0,
  KEY `name`(`name`),
  CONSTRAINT productsProductlines FOREIGN KEY (productlineId) REFERENCES productlines(id)
) AUTO_INCREMENT=111;


INSERT INTO products(id,`name`,scale,description,inStock,inOrder,price,productlineId) VALUES (1,'1969 Harley Davidson Ultimate Chopper','1:10','This replica features working kickstand, front suspension, gear-shift lever, footbrake lever, drive chain, wheels and steering. All parts are particularly delicate due to their precise scale and require special care and attention.',7933,917,48.81,2),(2,'1952 Alpine Renault 1300','1:10','Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.',7305,778,98.58,1),(3,'1996 Moto Guzzi 1100i','1:10','Official Moto Guzzi logos and insignias, saddle bags located on side of motorcycle, detailed engine, working steering, working suspension, two leather seats, luggage rack, dual exhaust pipes, small saddle bag located on handle bars, two-tone paint with chrome accents, superior die-cast detail , rotating wheels , working kick stand, diecast metal with plastic parts and baked enamel finish.',6625,891,68.99,2),(4,'2003 Harley-Davidson Eagle Drag Bike','1:10','Model features, official Harley Davidson logos and insignias, detachable rear wheelie bar, heavy diecast metal with resin parts, authentic multi-color tampo-printed graphics, separate engine drive belts, free-turning front fork, rotating tires and rear racing slick, certificate of authenticity, detailed engine, display stand\r\n, precision diecast replica, baked enamel finish, 1:10 scale model, removable fender, seat and tank cover piece for displaying the superior detail of the v-twin engine',5582,867,91.02,2),(5,'1972 Alfa Romeo GTA','1:10','Features include: Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.',3252,842,85.68,1),(6,'1962 LanciaA Delta 16V','1:10','Features include: Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.',6791,726,103.42,1),(7,'1968 Ford Mustang','1:12','Hood, doors and trunk all open to reveal highly detailed interior features. Steering wheel actually turns the front wheels. Color dark green.',68,834,95.34,1),(8,'2001 Ferrari Enzo','1:12','Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.',3619,815,95.59,1),(9,'1958 Setra Bus','1:12','Model features 30 windows, skylights & glare resistant glass, working steering system, original logos',1579,798,77.90,6),(10,'2002 Suzuki XREO','1:12','Official logos and insignias, saddle bags located on side of motorcycle, detailed engine, working steering, working suspension, two leather seats, luggage rack, dual exhaust pipes, small saddle bag located on handle bars, two-tone paint with chrome accents, superior die-cast detail , rotating wheels , working kick stand, diecast metal with plastic parts and baked enamel finish.',9997,883,66.27,2),(11,'1969 Corvair Monza','1:18','1:18 scale die-cast about 10\" long doors open, hood opens, trunk opens and wheels roll',6906,799,89.14,1),(12,'1968 Dodge Charger','1:12','1:12 scale model of a 1968 Dodge Charger. Hood, doors and trunk all open to reveal highly detailed interior features. Steering wheel actually turns the front wheels. Color black',9123,771,75.16,1),(13,'1969 Ford Falcon','1:12','Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.',1049,759,83.05,1),(14,'1970 Plymouth Hemi Cuda','1:12','Very detailed 1970 Plymouth Cuda model in 1:12 scale. The Cuda is generally accepted as one of the fastest original muscle cars from the 1970s. This model is a reproduction of one of the orginal 652 cars built in 1970. Red color.',5663,802,31.92,1),(15,'1957 Chevy Pickup','1:12','1:12 scale die-cast about 20\" long Hood opens, Rubber wheels',6125,870,55.70,6),(16,'1969 Dodge Charger','1:12','Detailed model of the 1969 Dodge Charger. This model includes finely detailed interior and exterior features. Painted in red and white.',7323,866,58.73,1),(17,'1940 Ford Pickup Truck','1:18','This model features soft rubber tires, working steering, rubber mud guards, authentic Ford logos, detailed undercarriage, opening doors and hood,  removable split rear gate, full size spare mounted in bed, detailed interior with opening glove box',2613,806,58.33,6),(18,'1993 Mazda RX-7','1:18','This model features, opening hood, opening doors, detailed engine, rear spoiler, opening trunk, working steering, tinted windows, baked enamel finish. Color red.',3975,886,83.51,1),(19,'1937 Lincoln Berline','1:18','Features opening engine cover, doors, trunk, and fuel filler cap. Color black',8693,997,60.62,7),(20,'1936 Mercedes-Benz 500K Special Roadster','1:18','This 1:18 scale replica is constructed of heavy die-cast metal and has all the features of the original: working doors and rumble seat, independent spring suspension, detailed interior, working steering system, and a bifold hood that reveals an engine so accurate that it even includes the wiring. All this is topped off with a baked enamel finish. Color white.',8635,876,24.26,7),(21,'1965 Aston Martin DB5','1:18','Die-cast model of the silver 1965 Aston Martin DB5 in silver. This model includes full wire wheels and doors that open with fully detailed passenger compartment. In 1:18 scale, this model measures approximately 10 inches/20 cm long.',9042,828,65.96,1),(22,'1980s Black Hawk Helicopter','1:18','1:18 scale replica of actual Army\'s UH-60L BLACK HAWK Helicopter. 100% hand-assembled. Features rotating rotor blades, propeller blades and rubber wheels.',5330,882,77.27,3),(23,'1917 Grand Touring Sedan','1:18','This 1:18 scale replica of the 1917 Grand Touring car has all the features you would expect from museum quality reproductions: all four doors and bi-fold hood opening, detailed engine and instrument panel, chrome-look trim, and tufted upholstery, all topped off with a factory baked-enamel finish.',2724,747,86.70,7),(24,'1948 Porsche 356-A Roadster','1:18','This precision die-cast replica features opening doors, superb detail and craftsmanship, working steering system, opening forward compartment, opening rear trunk with removable spare, 4 wheel independent spring suspension as well as factory baked enamel finish.',8826,837,53.90,1),(25,'1995 Honda Civic','1:18','This model features, opening hood, opening doors, detailed engine, rear spoiler, opening trunk, working steering, tinted windows, baked enamel finish. Color yellow.',9772,813,93.89,1),(26,'1998 Chrysler Plymouth Prowler','1:18','Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.',4724,814,101.51,1),(27,'1911 Ford Town Car','1:18','Features opening hood, opening doors, opening trunk, wide white wall tires, front door arm rests, working steering system.',540,649,33.30,7),(28,'1964 Mercedes Tour Bus','1:18','Exact replica. 100+ parts. working steering system, original logos',8258,892,74.86,6),(29,'1932 Model A Ford J-Coupe','1:18','This model features grille-mounted chrome horn, lift-up louvered hood, fold-down rumble seat, working steering system, chrome-covered spare, opening doors, detailed and wired engine',9354,780,58.48,7),(30,'1926 Ford Fire Engine','1:18','Gleaming red handsome appearance. Everything is here the fire hoses, ladder, axes, bells, lanterns, ready to fight any inferno.',2018,753,24.92,6),(31,'P-51-D Mustang','1:72','Has retractable wheels and comes with a stand',992,800,49.00,3),(32,'1936 Harley Davidson El Knucklehead','1:18','Intricately detailed with chrome accents and trim, official die-struck logos and baked enamel finish.',4357,763,24.23,2),(33,'1928 Mercedes-Benz SSK','1:18','This 1:18 replica features grille-mounted chrome horn, lift-up louvered hood, fold-down rumble seat, working steering system, chrome-covered spare, opening doors, detailed and wired engine. Color black.',548,686,72.56,7),(34,'1999 Indy 500 Monte Carlo SS','1:18','Features include opening and closing doors. Color: Red',8164,806,56.76,1),(35,'1913 Ford Model T Speedster','1:18','This 250 part reproduction includes moving handbrakes, clutch, throttle and foot pedals, squeezable horn, detailed wired engine, removable water, gas, and oil cans, pivoting monocle windshield, all topped with a baked enamel red finish. Each replica comes with an Owners Title and Certificate of Authenticity. Color red.',4189,880,60.78,7),(36,'1934 Ford V8 Coupe','1:18','Chrome Trim, Chrome Grille, Opening Hood, Opening Doors, Opening Trunk, Detailed Engine, Working Steering System',5649,807,34.35,7),(37,'1999 Yamaha Speed Boat','1:18','Exact replica. Wood and Metal. Many extras including rigging, long boats, pilot house, anchors, etc. Comes with three masts, all square-rigged.',4259,736,51.61,4),(38,'18th Century Vintage Horse Carriage','1:18','Hand crafted diecast-like metal horse carriage is re-created in about 1:18 scale of antique horse carriage. This antique style metal Stagecoach is all hand-assembled with many different parts.\r\n\r\nThis collectible metal horse carriage is painted in classic Red, and features turning steering wheel and is entirely hand-finished.',5992,741,60.74,7),(39,'1903 Ford Model A','1:18','Features opening trunk,  working steering system',3913,607,68.30,7),(40,'1992 Ferrari 360 Spider red','1:18','This replica features opening doors, superb detail and craftsmanship, working steering system, opening forward compartment, opening rear trunk with removable spare, 4 wheel independent spring suspension as well as factory baked enamel finish.',8347,1603,77.90,1),(41,'1985 Toyota Supra','1:18','This model features soft rubber tires, working steering, rubber mud guards, authentic Ford logos, detailed undercarriage, opening doors and hood, removable split rear gate, full size spare mounted in bed, detailed interior with opening glove box',7733,0,57.01,1),(42,'Collectable Wooden Train','1:18','Hand crafted wooden toy train set is in about 1:18 scale, 25 inches in total length including 2 additional carts, of actual vintage train. This antique style wooden toy train model set is all hand-assembled with 100% wood.',6450,673,67.56,5),(43,'1969 Dodge Super Bee','1:18','This replica features opening doors, superb detail and craftsmanship, working steering system, opening forward compartment, opening rear trunk with removable spare, 4 wheel independent spring suspension as well as factory baked enamel finish.',1917,889,49.05,1),(44,'1917 Maxwell Touring Car','1:18','Features Gold Trim, Full Size Spare Tire, Chrome Trim, Chrome Grille, Opening Hood, Opening Doors, Opening Trunk, Detailed Engine, Working Steering System',7913,830,57.54,7),(45,'1976 Ford Gran Torino','1:18','Highly detailed 1976 Ford Gran Torino \"Starsky and Hutch\" diecast model. Very well constructed and painted in red and white patterns.',9127,798,73.49,1),(46,'1948 Porsche Type 356 Roadster','1:18','This model features working front and rear suspension on accurately replicated and actuating shock absorbers as well as opening engine cover, rear stabilizer flap,  and 4 opening doors.',8990,902,62.16,1),(47,'1957 Vespa GS150','1:18','Features rotating wheels , working kick stand. Comes with stand.',7689,840,32.95,2),(48,'1941 Chevrolet Special Deluxe Cabriolet','1:18','Features opening hood, opening doors, opening trunk, wide white wall tires, front door arm rests, working steering system, leather upholstery. Color black.',2378,787,64.58,7),(49,'1970 Triumph Spitfire','1:18','Features include opening and closing doors. Color: White.',5545,867,91.92,1),(50,'1932 Alfa Romeo 8C2300 Spider Sport','1:18','This 1:18 scale precision die cast replica features the 6 front headlights of the original, plus a detailed version of the 142 horsepower straight 8 engine, dual spares and their famous comprehensive dashboa